import React from 'react'
import Sidebar from '../Sidebar/Sidebar'

const Layout = () => {
    return (
        <div className='App'>
            <Sidebar />
            <div className='page'>
                <span className='tag top-tags'>&lt;body&gt;</span>

            </div>
        </div>
    )
}

export default Layout
